import React from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link 
            to="aboutMe" 
            smooth={true} 
            duration={500} 
            spy={true} 
            activeClass="active"
          >
            About Me
          </Link>
        </li>
        <li>
          <Link 
            to="qualifications" 
            smooth={true} 
            duration={500} 
            spy={true} 
            activeClass="active"
          >
            My Qualifications
          </Link>
        </li>
        <li>
          <Link 
            to="journey" 
            smooth={true} 
            duration={500} 
            spy={true} 
            activeClass="active"
          >
            My Journey
          </Link>
        </li>
        <li>
          <Link 
            to="projects" 
            smooth={true} 
            duration={500} 
            spy={true} 
            activeClass="active"
          >
            Projects
          </Link>
        </li>
        <li>
          <Link 
            to="hobbies" 
            smooth={true} 
            duration={500} 
            spy={true} 
            activeClass="active"
          >
            Hobbies
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
